import React, { Component } from "react";

class Image extends Component {
  state = {};
  render() {
    const { image, direction } = this.props;
    if (direction === "Left") {
      return (
        <>
          <img src={image} className="flip"></img>
        </>
      );
    }
    return (
      <>
        <img src={image}></img>
      </>
    );
  }
}

export default Image;
